import { BrowserRouter as Route, Routes, Router } from 'react-router-dom';
import './App.css';
import Layout from "./components/Layout";

function App() {
  return (
      <Routes>
        <Route path="/" element={<Layout />}>
        </Route>
      </Routes>
  );
}

export default App;
